import React from "react";
import { Dropdown, Menu } from "antd";
import { useSelector } from "react-redux";

const menu = (
  <Menu>
    <Menu.Item key={1}>Thông tin cá nhân</Menu.Item>
    <Menu.Item key={2}>Tới trang Quản trị</Menu.Item>
    <hr />
    <Menu.Item key={4}>Đăng xuất</Menu.Item>
  </Menu>
);

export default function UserLogged() {
  const { userInfor } = useSelector((state) => state.quanLyNguoiDungReducer);

  return (
    <div className="flex items-center">
      <h1 className="mr-2 font-sans">{userInfor.hoTen}</h1>
      <Dropdown overlay={menu} trigger={["click"]}>
        <a onClick={(e) => e.preventDefault()}>
          <img
            style={{ width: 50, height: 50, borderRadius: "100%" }}
            src="https://picsum.photos/200"
            alt="avatar"
          />
        </a>
      </Dropdown>
    </div>
  );
}
